  // }, [])

  // return isLoggedIn ? <Home /> : <Login />

  return (
    <Router>
      <Routes>
        <Route path='/login' exact component={Login} />
        <Route path='/home' component={Home} />
        <Route path='/signup' component={Signup} />
      </Routes>
    </Router>
  )
}

export default App
